(4, 'Cookieverklaring', '<p>Deze website gebruikt alleen cookies voor een correcte weergave van de site.</p>', NULL, '2020-07-16 16:09:00', '2020-07-27 00:39:13'),
(6, 'Privacy', '<p>We bewaren je gegevens alleen als je ons zelf een verzoek stuurt of je inschrijft voor de nieuwsbrief.</p>\r\n\r\n<p>Je gegevens worden niet aan derden verstrekt.</p>', NULL, '2020-07-16 16:23:00', '2020-07-22 20:35:28'),
(11, 'EWA Haaglanden in het nieuws', '<p><a href=\"https://rocmondriaan.nl/nieuws/2020-10-22-45-miljoen-voor-ewa\">https://rocmondriaan.nl/nieuws/2020-10-22-45-miljoen-voor-ewa</a>&nbsp;</p>\r\n\r\n<p><a href=\"https://dagblad070.nl/Den Haag &amp; Regio/subsidie-voor-project-entree-wegen-naar-arbeid\">https://dagblad070.nl/Den Haag &amp; Regio/subsidie-voor-project-entree-wegen-naar-arbeid</a></p>\r\n\r\n<p><a href=\"https://www.ondernemersbelang.nl/2020/10/45-miljoen-voor-ewa-haaglanden/\">https://www.ondernemersbelang.nl/2020/10/45-miljoen-voor-ewa-haaglanden/</a></p>\r\n\r\n<p><a href=\"https://zoetermeersdagblad.nl/den haag %26 regio/subsidie-voor-project-entree-wegen-naar-arbeid\">https://zoetermeersdagblad.nl/den haag %26 regio/subsidie-voor-project-entree-wegen-naar-arbeid</a></p>\r\n\r\n<p><a href=\"https://rijswijksdagblad.nl/den haag %26 regio/subsidie-voor-project-entree-wegen-naar-arbeid\">https://rijswijksdagblad.nl/den haag %26 regio/subsidie-voor-project-entree-wegen-naar-arbeid</a></p>\r\n\r\n<p><a href=\"https://voorburgsdagblad.nl/den%20haag%20%26%20regio/subsidie-voor-project-entree-wegen-naar-arbeid\">https://voorburgsdagblad.nl/den%20haag%20%26%20regio/subsidie-voor-project-entree-wegen-naar-arbeid</a></p>\r\n\r\n<p><a href=\"https://www.nationaleonderwijsgids.nl/mbo/nieuws/55967-entree-wegen-naar-arbeid-onder-leiding-van-roc-mondriaan-van-start.html#.X5GQXE6yoYo.twitter\">https://www.nationaleonderwijsgids.nl/mbo/nieuws/55967-entree-wegen-naar-arbeid-onder-leiding-van-roc-mondriaan-van-start.html#.X5GQXE6yoYo.twitter</a></p>\r\n\r\n<p>&nbsp;</p>', NULL, '2020-10-30 09:00:20', NULL),
(13, 'Inspiratie voor EWA Haaglanden vonden we bij .... sociale zaken', '<p>Gemeenten in de arbeidsmarktregio Haaglanden zijn vereneigd in het Regionaal Platform Arbeidsmarktbeleid <a href=\"https://www.rpa-haaglanden.nl/\">https://www.rpa-haaglanden.nl/</a></p>\r\n\r\n<p>De regio Haaglanden werkt samen in perspectief op werk <a href=\"https://www.samenvoordeklant.nl/sites/default/files/bestandsbijlage/Actieplan%20PoW%20Haagla nden.pdf\">https://www.samenvoordeklant.nl/sites/default/files/bestandsbijlage/Actieplan%20PoW%20Haagla nden.pdf</a></p>\r\n\r\n<p>De landelijke informatie daarover staat hier&nbsp;<a href=\"https://www.perspectiefopwerk.info/\">https://www.perspectiefopwerk.info/</a></p>', NULL, '2020-10-30 09:28:43', NULL),
(14, 'Inspiratie voor EWA Haaglanden vonden we bij .... de aanpak van voortijdig schoolverlaten', '<p>Binnen de RMC-regio Haaglanden werken VO-scholen, mbo-instellingen en gemeenten aan het terugdringen van voortijdig schoolverlaten <a href=\"https://vsv-nee.nl/\">https://vsv-nee.nl/</a></p>', NULL, '2020-10-30 09:29:48', NULL),
(15, 'Inspiratie voor EWA Haaglanden vonden we bij .... LerenDoen', '<p>LerenDoen verzorgt in samenwerking met ROC Mondriaan opleidingen fietstechniek mbo niveau 1-2. De directeur van LerenDoen is lid van de klankbordgroep van Ewa Haaglanden. <a href=\"https://lerendoen.org/\">https://lerendoen.org/</a></p>', NULL, '2020-10-30 09:31:02', NULL),
(16, 'Inspiratie voor EWA Haaglanden vonden we bij .... andere publiek-private intiatieven', '<p>Inspiratie voor Ewa Haaglanden deden wij op bij o.a. de initiatieven Lelytalent (ROC van Flevoland en partners <a href=\"https://netwerk.wijzijnkatapult.nl/netwerk/124/lelytalent/\">https://netwerk.wijzijnkatapult.nl/netwerk/124/lelytalent/</a>), Duurzame Inzetbaarheid Brainport Regio Eindhoven (Summa College en partners <a href=\"https://netwerk.wijzijnkatapult.nl/netwerk/343/duurzame-inzetbaarheid-brainport-regio-eindhovenmeer-duurzame-kansen-voor-mensen-met-een-afstand-tot-de-arbeidsmarkt/?f66=1\">https://netwerk.wijzijnkatapult.nl/netwerk/343/duurzame-inzetbaarheid-brainport-regio-eindhovenmeer-duurzame-kansen-voor-mensen-met-een-afstand-tot-de-arbeidsmarkt/?f66=1</a>) en Participatielab Zeeland (ROC Scalda en partners&nbsp;<a href=\"https://netwerk.wijzijnkatapult.nl/netwerk/341/participatielab-zeeland/?f66=1\">https://netwerk.wijzijnkatapult.nl/netwerk/341/participatielab-zeeland/?f66=1</a>)</p>', NULL, '2020-10-30 09:32:00', '2020-10-30 09:39:09'),
(17, 'EWA Haaglanden wordt ondersteund door....', '<p>Ewa Haaglanden wordt mede mogelijk gemaakt door subsidie uit het Regionaal Investeringsfonds mbo van het Ministerie van Onderwijs, Cultuur en Wetenschappen <a href=\"https://www.rijksoverheid.nl/ministeries/ministerie-van-onderwijs-cultuur-en-wetenschap\">https://www.rijksoverheid.nl/ministeries/ministerie-van-onderwijs-cultuur-en-wetenschap</a></p>\r\n\r\n<p>De Dienst Uitvoering Subsidies aan Instellingen ondersteunt de beoordelingscommissie Regionaal Investeringsfonds mbo <a href=\"https://www.dus-i.nl/subsidies/regionaal-investeringsfonds-mbo\">https://www.dus-i.nl/subsidies/regionaal-investeringsfonds-mbo</a></p>', NULL, '2020-10-30 09:33:50', NULL),
(18, 'Inspiratie voor EWA Haaglanden vonden we bij .... de leercirkel motie Kwint/Özdil', '<p>Ook in de leercirkel motie Kwint/Ozdil wordt gewerkt aan een sterke arbeidsmarktpositie van jongeren <a href=\"https://www.16-27.nl/pilots/motie-kwintozdil\">https://www.16-27.nl/pilots/motie-kwintozdil</a></p>', NULL, '2020-10-30 09:35:12', NULL),
(19, 'Inspiratie voor EWA Haaglanden vonden we bij .... Ton Eimers', '<p>Bij het opstellen van de plannen voor Ewa Haaglanden zijn we ge&iuml;nspireerd door Ton Eimers van adviesbureau KBA Nijmegen <a href=\"https://www.kbanijmegen.nl/\">https://www.kbanijmegen.nl/</a></p>', NULL, '2020-10-30 09:36:04', NULL),
(20, 'Feestelijke start van partner de Energieacademie', '<p>Over de start van Ewa Haaglanden partner de Energieacademie is het volgende filmpje gemaakt <a href=\"https://youtu.be/VAKNG8Z7OYs\">https://youtu.be/VAKNG8Z7OYs</a></p>', NULL, '2020-10-30 09:36:47', NULL),
(21, 'Inspiratie voor EWA Haaglanden vonden we bij .... het landelijke pps-netwerk Katapult', '<p>Binnen het landelijke netwerk Katapult verzamelen zich publiek-private netwerksamenwerkingen <a href=\"https://www.wijzijnkatapult.nl/\">https://www.wijzijnkatapult.nl/</a></p>', NULL, '2020-10-30 09:37:48', NULL),
(22, 'Inspiratie voor EWA Haaglanden vonden we bij .... ZorgZijnWerkt', '<p>Werkgevers in de zorg in onze regio zijn verenigd in de organisatie ZorgZijnWerkt, de directeur van ZorgZijnWerkt is lid van de klankbordgroep van Ewa Haaglanden <a href=\"https://www.zorgzijnwerkt.nl/\">https://www.zorgzijnwerkt.nl/</a></p>', NULL, '2020-10-30 09:38:28', NULL);
