INSERT INTO `posts` (`id`, `title`, `content`, `reaction`, `created`, `updated`, `image`) VALUES
(1, 'Ewa Haaglanden feestelijk van start', '<p>Na meer dan een jaar groeiende samenwerking was het zo ver: op woensdag 4 maart 2020 vond de feestelijke opening plaats van Ewa Haaglanden! In buurtcentrum O3, waar studenten van de entreeopleiding van ROC Mondriaan een horeca-opleiding volgen, werd de symbolische bruidstaart aangesneden.</p>\r\n\r\n<p>Ook werd de Ewa Haaglanden introductiefilm getoond. Hierin wordt uitgelegd wat Ewa Haaglanden is, en waarom de samenwerking tussen bedrijven, gemeenten, en ROC Mondriaan zo ontzettend belangrijk is om de betrokken jongeren succesvol te begeleiden naar een diploma en werk.</p>', NULL, '2020-03-04 11:18:00', '2020-09-21 11:14:05', '5e9733c5168fd-5f0a35e4491c9605038024.jpeg'),
(2, 'Subsidieaanvraag Ewa Haaglanden', '<p>Sinds najaar 2018 is er gewerkt aan de verbinding tussen de entreeopleiding en de arbeidsmarkt.</p>\r\n\r\n<p>Dit is uitgemond in een subsidieaanvraag bij het Regionaal Investeringsfonds mbo. De betrokken partijen &ndash; bedrijven, gemeenten, (sociaal) ondernemers, ondersteuners, en ROC Mondriaan - hebben drie routes voor ontwikkeld.</p>\r\n\r\n<p>Er is een blauwe route: uitgevallen studenten van de entreeopleiding van ROC Mondriaan worden begeleid naar werk, en medewerkers binnen bedrijven of mensen met een afstand tot de arbeidsmarkt worden geschoold zodat zij daarmee beter aan de slag kunnen (blijven). Er is een gele route: studenten van de entreeopleiding van ROC Mondriaan volgen de opleiding binnen het bedrijf, met ondersteuning vanuit bedrijf, gemeenten en de school. En er is een rode route: de reguliere entreeopleiding van ROC Mondriaan wordt door de ervaringen in de blauwe en de gele route meer arbeidsmarktrelevant gemaakt.</p>', NULL, '2020-05-31 11:17:00', '2020-09-21 11:13:28', 'plaat-ewa-haaglanden-5f105837492d9370890614.png'),
(3, 'Opening samenwerkingsverband entree-arbeidsmarkt', '<p>Op 10 oktober 2019 is het samenwerkingsverband entree-arbeidsmarkt feestelijk geopend.</p>\r\n\r\n<p>Het doel van het netwerk is de arbeidsmarktpositie te verbeteren van jongeren van de entreeopleiding, mensen met een laag opleidingsniveau op de werkvloer, en mensen met een afstand tot de arbeidsmarkt.</p>\r\n\r\n<p>Veel organisaties in de regio Haaglanden werken hier al aan, en samen kunnen we n&oacute;g meer bereiken. In het netwerk vinden we elkaar sneller. Op de bijeenkomst werden regionale initiatieven gepresenteerd zoals praktijkleren met een praktijkverklaring (ROC Mondriaan i.s.m. arbeidsmarktregio Haaglanden), de Energieacademie, opleiden op de werkvloer bij thuiszorgorganisatie Florein, de samenwerking tussen de praktijkschool van het Hofstede College en ROC Mondriaan, de horeca-opleiding van Mondriaan bij buurtcentrum O3, en het regionale vsv-project Maatwerktrajecten naar onderwijs en arbeid.</p>\r\n\r\n<p>Zie voor de initiatieven:<a href=\"https://wsphaaglanden.nl/praktijkleren/praktijkleren-met-een-mbo-praktijkverklaring1\"> Praktijkleren met een praktijkverklaring</a>, <a href=\"http://www.haagseenergieacademie.nl\">Energieacademie</a>, <a href=\"https://www.florein.nl\">Thuiszorgorganisatie Florein</a> , <a href=\"https://hofstedecollege.nl/ons-college/examens-mbo\">Hofstede college</a>,&nbsp; <a href=\"http://www.o3-rivierenbuurt.nl/partners-a-bondgenoten-o3/o3-buurtrestaurant\">O3</a>,&nbsp; <a href=\"https://vsv-nee.nl/maatregelen/4\">Maatwerktrajecten naar onderwijs en arbeid </a></p>', NULL, '2019-10-11 16:45:00', '2020-09-29 17:18:03', 'dsc-0789-5f105016c6c4b325600438.jpg'),
(6, 'Studenten ROC Mondriaan ontwikkelen website voor Ewa Haaglanden', '<p>Studenten van de School voor ICT van ROC Mondriaan hebben in een afstudeeropdracht een website voor Ewa Haaglanden ontworpen.</p>\r\n\r\n<p>Het ontwerp van student Michael is uiteindelijk uitgekozen. Alle studenten zijn inmiddels ook geslaagd en hebben hun diploma ontvangen. Van harte gefeliciteerd!</p>', NULL, '2020-07-16 15:07:00', '2020-09-29 17:16:39', 'websitebouwen-5f1052813b5fa340284275.webp'),
(7, 'Eerste studenten van Florein Zorg ontvangen diploma', '<p>Zorgorganisatie Florein en ROC Mondriaan leiden sinds de zomer van 2019 studenten op als assistent zorg, op de werkvloer bij zorgorganisatie Florein.</p>\r\n\r\n<p>Op dinsdag 14 juli was het zover: aan 10 studenten werd een diploma uitgereikt, allemaal geslaagd! Het gaat om jonge mensen die tot nu toe geen diploma in het onderwijs hebben weten te behalen. Ze zijn de schoolbanken eigenlijk ontgroeid, maar willen toch nog dat felbegeerde papiertje. Deze jongeren kregen een speciaal traject op maat dat ze nu met een diploma konden afsluiten. De studenten gingen samen met een professional van Florein langs bij thuiszorgcli&euml;nten.</p>\r\n\r\n<p>Ze leerden daardoor niet alleen de taken van een thuiszorgmedewerker uit te voeren en om te gaan met de cli&euml;nten, maar ook om op tijd te komen en afspraken na te komen. Een docent van de School voor Entree gaf de inhoudelijke lessen op de werkvloer. Florein kan de menskracht goed gebruiken en de school de kans op werkervaring voor studenten.</p>\r\n\r\n<p>Virginia Nurmohamed, Zorgmanager van Florein Thuiszorg en Philip Nijgh, directeur van de School voor Entreeopleidingen, zijn beiden trots dat het gelukt is: &quot;Dit is zoals je moet opleiden en het is win-win voor beide organisaties.&quot;&rsquo; Beide organisaties zijn z&oacute; tevreden met de samenwerking dat met ingang van september 2020 een structurele samenwerking wordt aangegaan. Inmiddels hebben ook ander bedrijven en organisaties interesse getoond.</p>', NULL, '2020-07-16 16:03:00', '2020-09-21 11:13:00', '20200714-diplomering-florein-5f105e30afcc5899584160.png'),
(8, 'Opleidingen op de werkvloer bij Florein, Hanos en de Energieacademie van start', '<p>Het schooljaar 2020-2021 is gestart voor de studenten van ROC Mondriaan bij Ewa-partners Florein, Hanos en de Energieacademie. Zij volgen hun opleiding dit jaar geheel op de werkvloer.</p>\r\n\r\n<p>Alle studenten veel succes, en aan de partners een dikke pluim voor het cre&euml;ren van deze superkans voor onze jongeren!</p>', NULL, '2020-09-21 19:26:00', '2020-09-21 19:46:13', 'opening-schooljaar20-21-florein-kopie-5f68e6e5c33eb971215031.jpg'),
(9, 'Ondersteuning door gemeenten Delft, Den Haag, Rijswijk en Westland in eerste ontwerp', '<p>Gemeenten Den Haag, Westland, Rijswijk, Delft en ROC Mondriaan schetsen de contouren van gezamenlijke ondersteuning aan jongeren in de entreeopleiding.</p>\r\n\r\n<p>Binnen Ewa Haaglanden gaan we hier in 4 jaar een succes van maken.</p>\r\n\r\n<p>Chapeau allen, en op naar een hele mooie testversie van het ontwerp!</p>', NULL, '2020-09-21 19:45:26', NULL, 'ondersteuningsessie-kopie-5f68e6b6b71d8597121759.jpg'),
(10, 'Hanos trots op samenwerking', '<p>EWA Haaglanden partner Hanos is verheugd over de opleiding op de werkvloer. Vestigingsmanager Marc Waslander meldt: &#39;HANOS Delft en ROC Mondriaan zijn nu gezamenlijk 1 maand onderweg in het EWA Haaglanden project waarbij jongeren de kans krijgen om hun niveau 1 diploma te behalen dmv leren en werken op de werkvloer. Hoog tijd om dit te vieren met een gezamenlijke maaltijd, bereid door de leerlingen zelf. Wij zijn er trots op!!!</p>', NULL, '2020-10-13 16:11:08', NULL, '4-5f85b57cd136f936372705.jpg'),
(11, 'Innovatiesubsidie voor EWA Haaglanden', '<p>Op 20 oktober 2020 werd bekend dat EWA Haaglanden een prestigieuze innovatiesubsidie ontvangt: een subsidie uit het Regionaal Investeringsfonds mbo.&nbsp;</p>\r\n\r\n<p>De subsidie maakt het mogelijk de komende 4 jaar in een netwerk van bedrijven, gemeenten, non profit partners en onderwijspartijen verder te bouwen aan scholing en werk voor jongeren in de regio Haaglanden. Samen bezorgen we jongeren hun allereerste diploma, en werk.</p>\r\n\r\n<p>Alle partners van harte gefeliciteerd met dit geweldige succes!&nbsp;</p>', NULL, '2020-10-21 10:16:00', '2020-10-21 10:27:31', 'partners-ewa-5f8ff0f32de7f584313369.jpg'),
(15, 'Aandacht in de pers voor de start van EWA Haaglanden', '<p>Het is niet onopgemerkt gebleven. EWA Haaglanden ontvangt een innovatiesubsidie van het ministerie van OCW. Ook in partnergemeente Rijswijk was daar aandacht voor.</p>\r\n\r\n<p>https://rijswijksdagblad.nl/den haag %26 regio/subsidie-voor-project-entree-wegen-naar-arbeid</p>\r\n\r\n<p>Zie voor de nieuwsberichten in dag- en weekbladen de informatiepagina.</p>', NULL, '2020-10-30 09:57:00', '2020-10-30 11:27:17', 'rijswijksdagblad.nl-5f9bd568a6265186614677.jpg');
